import mobile2x_1 from '../../image/main_img/1mobile2x.png'
import tablet2x_1 from '../../image/main_img/1tablet2x.png'
import desktop2x_1 from '../../image/main_img/1desktop2x.png'
const MainPage = () => {
    return (
        <div className="mainContainer">
            
            <h1 className="mainTitle">Take good care of your small pets</h1>
            <div className="imageContainer">
                <img className="imageOne" src={mobile2x_1} alt="" />
                <img className="imageTwo" src={tablet2x_1} alt="" />
                <img className="imageThree" src={desktop2x_1} alt="" />
            </div>
        </div>
    );
}

export default MainPage;
